<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Operators - Of</title>
    <script src="https://unpkg.com/@reactivex/rxjs@6.3.3/dist/global/rxjs.umd.js"></script>
  </head>
  <body>
    <script>
      const { of } = rxjs;

      of(1, 2, true, "string").subscribe((x) => console.log(x));
    </script>
  </body>
</html>
